import Link from 'next/link'
import { Icon } from 'semantic-ui-react'

const linkStyle = {
  marginRight: 15
}

export default function Header() {
  return (
    <div>
      <Icon name='home' size='tiny' />
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
    </div>
  )
}
